import React from "react";
import { BrowserRouter , Route } from "react-router-dom";
import Login from './pages/Login';

export default function Routes(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" exact Component={Login}/>
            </Routes>
        </BrowserRouter>
    );
}
